import './Nav.css';

function RightCard() {
    return (
        <div className="sub-container-2">
            <div className="nav-bar">
            <div className="abt">
                About
            </div>
            <div className="right-bar">
                <Router>
                    <Link to="/education">Education</Link>
                    <Link to="/projects">Projects</Link>
                    <Link to="/skills">Skills</Link>
                    <Link to="">Resume</Link>
                </Router>
            </div>
        </div>
        </div>
    );
}

export default RightCard;
